import React from "react";
import Product from "../product/Product";
import "./home.css";

function Home({donanimArsivi, kucukBurjuvazi}) {
  return (
    <div className="container-home">
      <div className="content-home">
        <div className="sidebar">
          <p>Fenomenler</p>
          <div className="fenomenler">
            <a href="/donanim-arsivi">Donanım Arşivi</a>
            <a href="/kucuk-burjuvazi">Küçük Burjuvazi</a>
          </div>
        </div>
        <div className="product-home">
          <p>Son eklenen ilanlar</p>
          <div className="product-home-box">
          <Product products={kucukBurjuvazi} title={"Küçük Burjuvazi İlanları"}/>
          <Product products={donanimArsivi} title={"Küçük Burjuvazi İlanları"}/>
          </div>
        </div>
      </div>
    </div>
  );
}

export default Home;
